import top100Icon from "../../Components/top100Icon";
import danceIcon from "../../Components/danceIcon";
import recursiveAssing from "@/Functions/RecursiveAssign";
export default {
  data() {
    return {
      navList: [{
        name: "Танцювальна битва",
        icon: danceIcon,
        path: "Select"
      }, {
        name: "Рейтинг танцюристів",
        icon: top100Icon,
        path: "Rating"
      }],
      selectDanceData: {
        price: 0,
        availableSongsId: []
      },
      playersNear: [],
      personalRating: null,
      ratingList: []
    };
  },
  computed: {
    currentNavName() {
      return this.navList.find(nav => this.isCurrentPath(nav.path)).name;
    }
  },
  methods: {
    goToPath(path) {
      this.$router.push(path);
    },
    isCurrentPath(path) {
      return this.$route.path.includes(path);
    },
    onCloseApp() {
      this.$callClient("C:DanceMiniGame:Close");
    },
    setData(data) {
      recursiveAssing(data, this, true);
    }
  },
  mounted() {
    this.$onClient("W:DanceMiniGame:SetData", this.setData);
    this.$callClient("C:DanceMiniGame:Ready");
  },
  components: {}
};
